import adminCatalog from '../../../assets/personal-account/admin-catalog.jpg';
import adminProducts from '../../../assets/personal-account/admin-products.png';

const buttonAuthorizedPageArray = [{
  className: 'historyOrdersColumn',
  text: 'История заказов',
  type: 'column',
},
{
  className: 'basketColumn',
  text: 'Текущие товары',
  type: 'column',
},
{
  className: 'personalDataColumn',
  text: 'Личные данные',
  type: 'column',
},
{
  className: 'exitButton',
  text: 'Выйти',
  type: 'column',
},
{
  className: 'historyOrdersRow',
  classNameString: 'historyOrdersString',
  text: 'История заказов',
  type: 'row',
  src: adminCatalog,
  image: 'adminCatalog',
},
{
  className: 'basketRow',
  classNameString: 'basketString',
  text: 'Текущие товары',
  type: 'row',
  src: adminProducts,
  image: 'adminCatalog',
},
{
  className: 'personalDataRow',
  classNameString: 'personalAccountString',
  text: 'Личные данные',
  type: 'row',
},
];

export default buttonAuthorizedPageArray;
